    /// <summary>For any given utf-8 glyph determines the associated homoglyphs.</summary>
    /// <param name="codepoint">The utf-8 glyph to probe.</param>
    public static ReadOnlySpan<uint> GetHomoglyphs(char codepoint) {
        return GetHomoglyphs((nuint)codepoint);
    }

    /// <summary>For any given utf-32 glyph determines the associated homoglyphs.</summary>
    /// <param name="codepoint">The utf-32 glyph to probe.</param>
    /// <returns></returns>
    public static ReadOnlySpan<uint> GetHomoglyphs(nuint codepoint) {
        ref uint blockValues = ref Unsafe.As<byte, uint>(ref MemoryMarshal.GetReference(ValuesBlockOrder));
        ref uint hashValues = ref Unsafe.As<byte, uint>(ref MemoryMarshal.GetReference(ValuesHashOrder));
        ref ushort hashIndicies = ref Unsafe.As<byte, ushort>(ref MemoryMarshal.GetReference(BlockIndicesHashOrder));
        ref byte hashLengths = ref MemoryMarshal.GetReference(BlockLengthsHashOrder);

        nuint predictionCount = 0;
        nuint prediction = FastMod(codepoint);
        nuint probeValue;
        while (true) {
#if NET6_0_OR_GREATER
            probeValue = Unsafe.Add(ref hashValues, prediction);
            if (probeValue == codepoint) {
                ushort index = Unsafe.Add(ref hashIndicies, prediction);
                byte length = Unsafe.Add(ref hashLengths, prediction);
#else
            probeValue = Unsafe.Add(ref hashValues, Unsafe.As<nuint, IntPtr>(ref prediction));
            if (probeValue == codepoint) {
                ushort index = Unsafe.Add(ref hashIndicies, Unsafe.As<nuint, IntPtr>(ref prediction));
                byte length = Unsafe.Add(ref hashLengths, Unsafe.As<nuint, IntPtr>(ref prediction));
#endif
                return MemoryMarshal.CreateReadOnlySpan(ref Unsafe.Add(ref blockValues, index), length);
            }
            if (predictionCount <= HashCapacity) {
                predictionCount += 1;
                prediction = FastMod(prediction + (predictionCount * predictionCount));
                continue;
            }

            return default;
        }
    }

    /// <summary>Computes `mod(value, HashCapcity)`</summary>
    [MethodImpl(MethodImplOptions.AggressiveInlining)]
    private static nuint FastMod(nuint value) {
#if TARGET_64BIT
        return ((((FastModMultiplier * value) >> 32) + 1) * HashCapacity) >> 32;
#else
        return value % HashCapacity;
#endif
    }
